import React from "react";
import { TextField } from "@mui/material";

const PersonalInfo = ({ formData, setFormData }) => {
  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  return (
    <div>
      <h2>اطلاعات شخصی</h2>
      <TextField fullWidth label="نام" name="name" value={formData.name} onChange={handleChange} margin="normal" />
      <TextField fullWidth label="نام خانوادگی" name="lastName" value={formData.lastName} onChange={handleChange} margin="normal" />
      <TextField
        fullWidth
        label="شماره تماس"
        name="phone"
        type="tel"
        value={formData.phone}
        onChange={handleChange}
        error={formData.phone.length !== 11 && formData.phone.length > 0}
        helperText={formData.phone.length !== 11 && formData.phone.length > 0 ? "شماره باید ۱۱ رقم باشد" : ""}
        margin="normal"
      />
      <TextField fullWidth label="تاریخ تولد" name="birthDate" type="date" value={formData.birthDate} onChange={handleChange} margin="normal" InputLabelProps={{ shrink: true }} />
    </div>
  );
};

export default PersonalInfo;
